import React, { useRef } from 'react'
function Component(props) {
    const ref=useRef(null)
    const {count,displayCount}=props;
  return (
    <div className="sub-comp" id='ref' ref={ref} onClick={displayCount}>
    <h1>{count}</h1>     
       </div>
  )
}

export default Component
